        // Fetch weather data from the Flask backend
        axios.get("/weather_by_date")
          .then(response => {
            setDate(response.data);
          })
          .catch(error => {
            console.error('Error fetching weather data:', error);
          });
      }, []);

  return (
    <div>Weather_by_date</div>
  )
}
